import React from 'react';
import { View, Text,Image } from 'react-native';
import { useNavigation } from '@react-navigation/native';

import { useRoute } from '@react-navigation/native';
import { StyleSheet,  TouchableHighlight } from "react-native";

function DetailsScreen()  {
  const navigation = useNavigation();
  const route =useRoute();
  const {param1, param2,param3} = route.params;
  
      return (
        <View style={{flexDirection: 'row'}}>
        <View style={{ flex: 1, alignItems:'flex-start',justifyContent: 'space-between'}}>
          <Image
       style={{width: '100%', alignSelf:'flex-start',height: 200,resizeMode : 'stretch' ,borderRadius:10}}
       source={{uri: param3}} 
       />
       </View>
       <View>
      <TouchableHighlight>
        <View style={{backgroundColor: '#FFEB3B'}}>
          <Text>{param1}</Text>
        </View>
      </TouchableHighlight>
      </View>
      <View style={styles.countContainer}>
        <Text style={styles.button}>
          {param2}
        </Text>
      </View>
    </View>
      );
    }


export default DetailsScreen;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    paddingHorizontal: 10
  },
  button: {
    alignItems: "center",
    backgroundColor: "#DDDDDD",
    padding: 10
  },
  
});
